CREATE TABLE IF NOT EXISTS `accounts` (
  `username` varchar(16) NOT NULL,
  `password` char(32) NOT NULL,
  `expiry_date` datetime NOT NULL,
  `max_users` tinyint(1) NOT NULL,
  `proxy` tinyint(1) NOT NULL,
  `email` varchar(64) NOT NULL,
  `mobile` char(10) NOT NULL,
  PRIMARY KEY (`username`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;


CREATE TABLE IF NOT EXISTS `onlines` (
  `id` mediumint(9) NOT NULL AUTO_INCREMENT,
  `username` varchar(16) NOT NULL,
  `machine_id` char(32) NOT NULL,
  `last_seen` datetime NOT NULL,
  PRIMARY KEY (`id`),
  KEY `username` (`username`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1 AUTO_INCREMENT=2 ;

CREATE TABLE IF NOT EXISTS `program` (
  `id` tinyint(1) NOT NULL,
  `version` decimal(2,1) NOT NULL,
  `release_date` char(10) NOT NULL,
  `proxy_server` varchar(32) NOT NULL,
  `room_id` int(11) NOT NULL,
  `channel_id` int(11) NOT NULL,
  `room_servers` varchar(256) NOT NULL,
  `talk_servers` varchar(1024) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;


CREATE TABLE IF NOT EXISTS `resellers` (
  `id` char(32) NOT NULL,
  `discount_percent` tinyint(4) NOT NULL,
  `credits` tinyint(4) NOT NULL,
  `description` varchar(128) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;